import React from "react";
import './css/FormCreateTodo.css';
import { TodoContext } from "../TodoProvider";
function TodoFormCreate()
{
    const {
        actionModal
      } = React.useContext(TodoContext);
 return(
    <form className="form-create-todo" onSubmit={(event) => {event.preventDefault();}}>
        <label className="label_title_form">Ingrese su primer TODO</label>
        <textarea className="textarea-text-todo"
        placeholder="Estudiar nuevos cursos"
        ></textarea>
        <div className="div-conteinerButton">
            <button className="btn-class btn-cancel" onClick={actionModal}>Cancelar</button>
            <button className="btn-class btn-add">
                <span className="btn-txt">Anadir</span>
                </button>
        </div>
    </form>
 );
}

export {TodoFormCreate}
